package com.dns.taxchina.service.model;import java.util.List;import netlib.model.BaseModel;/** * @author fubiao * @version create time:2014-4-24_下午2:44:42 * @Description 首页内容model */public class IndexContentItemModel extends BaseModel {	private static final long serialVersionUID = 1948392833519379194L;	private String id;	private boolean hasMore;	private String title;	private List<BaseItemModel> subList;	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public boolean isHasMore() {		return hasMore;	}	public void setHasMore(boolean hasMore) {		this.hasMore = hasMore;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public List<BaseItemModel> getSubList() {		return subList;	}	public void setSubList(List<BaseItemModel> subList) {		this.subList = subList;	}}